import React, { Fragment } from "react";
import { Button } from 'react-bootstrap';

export default function Index() {
    return (
        <Fragment>
            <div>
                <h1>Index</h1>
                <Button variant="primary">Primary</Button>{' '}
            </div>
        </Fragment>
    );
}
